import { registerDynImportEntry } from 'js/moduleLoader';
registerDynImportEntry('js/graphQLService', () => import('js/graphQLService'));
registerDynImportEntry('js/command.service', () => import('js/command.service'));
registerDynImportEntry('js/commandPanel.service', () => import('js/commandPanel.service'));
registerDynImportEntry('js/NotyModule', () => import('js/NotyModule'));
registerDynImportEntry('js/modifyCtxService', () => import('js/modifyCtxService'));;
export default {
    "GraphQL": {
        "actionType": "JSFunctionAsync",
        "method": "callGraphQL",
        "inputData": {
            "input": "{{inputData}}",
            "endPoint": "{{inputData.endPoint}}"
        },
        "deps": "js/graphQLService"
    },
    "Command": {
        "actionType": "JSFunction",
        "method": "executeCommandIfVisibleAndEnabled",
        "inputData": {
            "0": "{{inputData.commandId}}",
            "1": "{{inputData.commandContext}}",
            "2": "{{parameters.commandActionExecutor.runActionWithViewModel}}"
        },
        "deps": "js/command.service"
    },
    "activateCommandPanel": {
        "actionType": "JSFunction",
        "method": "activateCommandPanel",
        "deps": "js/commandPanel.service",
        "inputData": {
            "commandId": "{{inputData.commandId}}",
            "location": "{{inputData.location}}",
            "context": "{{inputData.context}}",
            "push": "{{inputData.push}}",
            "closeWhenCommandHidden": "{{inputData.closeWhenCommandHidden}}",
            "config": "{{inputData.config}}"
        }
    },
    "showInfoMessage": {
        "actionType": "JSFunction",
        "method": "showInfo",
        "inputData": {
            "message": "{{inputData.message}}",
            "params": "{{inputData.params}}"
        },
        "deps": "js/NotyModule"
    },
    "showWarningMessage": {
        "actionType": "JSFunction",
        "method": "showWarning",
        "inputData": {
            "message": "{{inputData.message}}",
            "params": "{{inputData.params}}"
        },
        "deps": "js/NotyModule"
    },
    "showErrorMessage": {
        "actionType": "JSFunction",
        "method": "showError",
        "inputData": {
            "message": "{{inputData.message}}",
            "params": "{{inputData.params}}"
        },
        "deps": "js/NotyModule"
    },
    "modifyCtx": {
        "actionType": "JSFunction",
        "method": "modifyCtx",
        "deps": "js/modifyCtxService",
        "inputData": {
            "methodType": "{{inputData.methodType}}",
            "name": "{{inputData.name}}",
            "value": "{{inputData.value}}",
            "path": "{{inputData.path}}"
        }
    }
};
